import "./Login.css";
import { useState } from "react";

function Login() {
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log({ email, password });
  };

  return (
    <div className="login-page">
      <div className="login-container">
        <div className="xnett-logo">
          <div className="logo">
            <img src="/omni logo.jpg" alt="OmniBSIC Bank Logo" />
          </div>
        </div>

        <h1>Login</h1>
        <div className="login-desc">Enter your login credentials</div>

        <div className="login-form">
          <form className="form" onSubmit={handleSubmit}>
            <div className="form-group">
              <label>Email Address</label>
              <input
                className="form-control"
                type="email"
                placeholder="Enter your email address"
                value={email}
                onChange={(e) => setEmail(e.target.value)}
                required
              />
            </div>

            <div className="form-group">
              <label>Password</label>
              <input
                className="form-control"
                type="password"
                placeholder="Enter your password"
                value={password}
                onChange={(e) => setPassword(e.target.value)}
                required
              />
            </div>

            <button className="btn-primary" type="submit">
              Login
            </button>
          </form>
        </div>

        <div className="footer-text">
          Â©2025 OmniBSIC Bank. Powered by Xnett. All rights reserved.
        </div>
      </div>

      <div
        className="login-img"
        style={{ backgroundImage: "url('/omni_photo.png')" }}
      />
    </div>
  );
}

export default Login;
